import React, { useState } from "react";
import styled from "styled-components";
import HomeIcon from "@mui/icons-material/Home";
import MenuOpenIcon from "@mui/icons-material/MenuOpen";
import CloseIcon from "@mui/icons-material/Close";

function Header() {
  const [openBurger, setOpenBurger] = useState(false);

  return (
    <Container>
      <a>
        <CustomHomeIcon />
      </a>
      <LeftMenu>
        <a href="#">Account</a>

        <a href="#">About</a>

        <a href="#">Contact</a>
      </LeftMenu>
      <RightMenu>
        <CustomBurger onClick={() => setOpenBurger(true)} />
      </RightMenu>
      <RightNav show={openBurger}>
        <NavWrap>
          <Close onClick={() => setOpenBurger(false)} />
        </NavWrap>

        <li>
          <a href="#">Payments</a>
        </li>
        <li>
          <a href="#">Maintanence</a>
        </li>
        <li>
          <a href="#">Apartments</a>
        </li>
        <li>
          <a href="#">Explore</a>
        </li>
        <li>
          <a href="#">Account</a>
        </li>
        <li>
          <a href="#">Help</a>
        </li>
      </RightNav>
    </Container>
  );
}

export default Header;

const NavWrap = styled.div`
  display: flex;
  justify-content: flex-end;
`;
const Close = styled(CloseIcon)`
  cursor: point;
  color: black;
`;
const RightNav = styled.div`
  position: fixed;
  top: 0;
  bottom: 0;
  right: 0;
  background: lightGrey;
  width: 250px;
  z-index: 5;
  list-style: none;
  padding: 20px;
  text-align: start;
  display: flex;
  flex-direction: column;
  border-radius: 3px;
  transform: ${(props) => (props.show ? "TranslateX(0)" : "translateX(100%)")};
  transition: transfrom 0.35s;
  li {
    padding: 20px 0;
    border-bottom: 2px solid rgba(0, 0, 0, 0.3);
  }

  a {
    font-weight: 800;
  }
`;

const CustomHomeIcon = styled(HomeIcon)`
  cursor: pointer;
`;

const CustomBurger = styled(MenuOpenIcon)`
  cursor: pointer;
`;

const Container = styled.div`
  z-index: 1;
  min-height: 40px;
  position: fixed;
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 0 20px;
  top: 0;
  left: 0;
  right: 0;
`;
const RightMenu = styled.div`
  display: flex;
  align-items: center;
`;
const LeftMenu = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  flex: 1;

  a {
    font-weight: 600;
    text-decoration: uppercase;
    padding: 0 10px; //top equals 0 sides equal 10
    flex-wrap: nowrap;
    text-align: right;
  }

  @media (max-width: 650px) {
    flex-direction: none;
  }
`;
